func countCompleteSubarrays(nums []int) int {
    totalElements := make(map[int]int)
    for _, num := range nums {
        totalElements[num]++
    }
    distinctCount := len(totalElements)

    count, left := 0, 0
    currentElements := make(map[int]int)
    for right := 0; right < len(nums); right++ {
        currentElements[nums[right]]++
        for len(currentElements) == distinctCount {
            if currentElements[nums[left]] == totalElements[nums[left]] {
                count += len(nums) - right
                currentElements[nums[left]]--
                if currentElements[nums[left]] == 0 {
                    delete(currentElements, nums[left])
                }
                left++
                break
            }
            currentElements[nums[left]]--
            if currentElements[nums[left]] == 0 {
                delete(currentElements, nums[left])
            }
            left++
        }
    }
